import React, { Component } from 'react';
import '../index.css';





export default class ImageSection extends React.Component{
      render(){

           return(
            <div>
                  <img src={this.props.backgroundImage} className="backgroundImage"></img>
                  <button type="file" onClick={this.uploadImage}>Upload Background</button>
            </div>
            )  
      }

}

const styles = {
      backgroundImage
}
